  var a =document.getElementById("A").value;
  var b =document.getElementById("B").value;
  var n =document.getElementById("N").value;

}

function Mester() {
  
  return (
    <div >
      <h1 className="test">Mestertétel</h1>
      <div >
      <a>T értéke (a): </a>
          <input type="text" id="A" className="mesterinput"/>
      </div>
      <br />
      <div >
      <a>n-es tag (b): </a>
          <input type="text" id="B" className="mesterinput"/>
      </div>
      <br />
      <div >
          <a>n : </a>
          <input type="text" id="N" className="mesterinput"/>
          <br />
          <br />
        <div>
          <Button onClick={szamol()} variant="secondary">
            Megold
          </Button>
        </div>
      </div>
    </div>
  );
}

export default Mester;
